import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import AddBook from "./pages/AddBook";
import AllStudents from "./pages/AllStudents";
import NewStudent from "./pages/NewStudent.js";
import AllBooks from "./pages/AllBooks.js";
import DeleteBook from "./pages/DeleteBook.js";
import BookById from "./pages/BookById.js";

function App() {
  return (
    <div className="App">
      <BrowserRouter> 
        <Routes>
          <Route index element={<Home/>}/>
          <Route>
          <Route path="/allbooks" element={<AllBooks/>}/>
          <Route path="/:id" element={<BookById/>}/>
          <Route path="/addbook" element={<AddBook/>}/>
          <Route path="/deletedbooks" element={<DeleteBook/>}/>
          <Route path="/allstudents" element={<AllStudents/>}/>
          <Route path="/newstudent" element={<NewStudent/>}/> 
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
